  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sand Lake NWR
  outlines Refuge accomplishments from September through December of 1943. The report
  begins by summarizing the weather conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, raptors, fish, and disease-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  fishing, and violations. Items of interest and N-R forms are attached.\",\n\t\"owner_org\":
